import React, { Component } from "react";
import './ChooseCarAdvance.css';

export default class ChooseCarAdvance extends Component {
  render() {
    return (
      <div>
        <div className="myname text-center p-1 mb-1">Đoàn Hoàng Thịnh</div>
        <div className="container-fluid">
          <div className="row">
            <div className="col-6">
              <div className="model">
                <img src="./caradvance/images-black/images-black-1/civic-1.jpg" alt="" />
              </div>
            </div>
            <div className="col-6">

            </div>
          </div>
        </div>
      </div>
    )
  }
}
